package pageObjects;import org.apache.xmlbeans.impl.xb.xsdschema.Public;import org.openqa.selenium.WebDriver;import org.openqa.selenium.WebElement;import org.openqa.selenium.support.FindBy;import org.testng.annotations.Test;public class HomePage extends BasePage{    public HomePage (WebDriver driver){        super(driver);    }    @FindBy(xpath = "//span[normalize-space()='My Account']")    WebElement linMyAccount;    @FindBy(xpath = "//a[normalize-space()='Register']")    WebElement linkRegister;    @FindBy(linkText = "Login")    WebElement linkLogin;    public void clickMyAccount()    {        linMyAccount.click();    }    public void clickRegister()    {        linkRegister.click();    }    public void clickLogin()    {        linkLogin.click();    }}